import React from "react";
import { makeStyles } from "@material-ui/core/styles";
import Grid from "@material-ui/core/Grid";
import Typography from "@material-ui/core/Typography";

const useStyles = makeStyles((theme) => ({
  root: {
    padding: theme.spacing(4),
    backgroundColor: "#f9f9f9",
  },
  image: {
    width: "100%",
    height: "auto",
    borderRadius: theme.spacing(1),
    [theme.breakpoints.up("sm")]: {
      maxWidth: 600,
    },
  },
  content: {
    textAlign: "center",
    [theme.breakpoints.up("sm")]: {
      textAlign: "left",
      paddingLeft: theme.spacing(4),
    },
  },
}));

const AboutUs = () => {
  const classes = useStyles();

  return (
    <div className={classes.root}>
      <Grid container spacing={4} alignItems="center">
        <Grid item xs={12} sm={6}>
          <img
            src="/Images/aboutus.jpg"
            alt="About Us"
            className={classes.image}
          />
        </Grid>
        <Grid item xs={12} sm={6} className={classes.content}>
          <Typography
            variant="h4"
            component="h2"
            gutterBottom
            style={{ color: "#da4ea2" }}
          >
            About Code School
          </Typography>
          <Typography variant="body1" paragraph>
            Lorem ipsum dolor sit amet, consectetur adipiscing elit. Mauris eget
            risus odio. Aliquam fermentum auctor tellus, non facilisis sem
            fermentum sed. In eget viverra mi. Fusce vel tortor sed nisl tempus
            volutpat vitae a mi. Nunc auctor tincidunt interdum.
          </Typography>
          <Typography variant="body1" paragraph>
            Curabitur ut quam sed leo malesuada convallis quis vel arcu.
            Suspendisse lacinia condimentum erat ac congue. Aliquam at
            vestibulum diam, eu accumsan mi. Vestibulum ante ipsum primis in
            faucibus orci luctus et ultrices posuere cubilia curae; Integer
            bibendum ipsum id ipsum efficitur, et accumsan sem vulputate.
          </Typography>
          <Typography variant="body1" paragraph>
            Vivamus quis mauris sit amet odio feugiat viverra. Sed eget
            ullamcorper odio. Suspendisse potenti. Donec cursus bibendum
            feugiat. Nullam in dolor et est laoreet egestas sed vitae lacus.
            Proin in iaculis magna.
          </Typography>
        </Grid>
      </Grid>
    </div>
  );
};

export default AboutUs;
